import "./App.css";
import Header from "./components/HomePage/Header";
import HomePageSlider from "./components/HomePage/HomePageSlider/HomePageSlider";
import PopularCars from "./components/PopularCars/PopularCars";
import SoldOutCars from "./components/SoldOutCars/SoldOutCars";
import TodaysAuction from "./components/TodaysAuction/TodaysAuction";

const App = () => {
  return (
    <div>
      <Header />
      <HomePageSlider />
      <div className="container">
        <h3 className="h3Font">Today's Auctions</h3>
        <TodaysAuction />
        <PopularCars />
        <SoldOutCars />
        <Footer />
      </div>
    </div>
  );
};

export default App;
